  or the U.S. Census Bureau, specifically as to the spatial or attribute accuracy
  of the data. The TIGER/Line Shapefiles may not be suitable for high-precision measurement
  applications such as engineering problems, property transfers, or other uses that
  might require highly accurate measurements of the earth's surface.Coordinates in
  the TIGER/Line shapefiles have six implied decimal places, but the positional accuracy
  of these coordinates is not as great as the six decimal places suggest.\", \"No
